import React from 'react';
import './Movie.css';

const Movie = (props) => {
  return (

    <div key={props.name} className="movie" >
      <div className="card">
        <div className="container">
      <img src={props.imageUrl} alt={`${props.name} poster`} />
      <p>{props.name}</p>
          <p>{props.genre}</p>
          <p>{props.year}</p>
        </div>
      </div>
    </div>
  );
}

export default Movie;
